const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    borderRadius: 5,
    boxShadow: "0 10px 30px #BBB",
    padding: 10,
    marginRight:"20px"
  },
  paper: {
    padding: theme.spacing(1),
    display:"flex",
    justifyContent:'center',
    backgroundColor:"#391465"
  },
 other:{
   borderRadius:"24px",
   border:"1px solid #1dbc4 " 
 }
}));


