  const [openCom,setOpencom] =useState(false);
  const classes = useStyles();


  return (<>
      <div className="commencer">
        <h1>Apprendre en<br></br>s'amusant</h1><br></br>
        <Button text="commencer" onClick={() => { setOpencom(true);}} style={{marginTop:"17px"}}/>
        </div>
        <Commencer title="Qui es-tu ?" className={classes.titre} setOpencom={openCom} setOpencom={setOpencom}>
            <div className={classes.root} direction="row">

                <Grid item className={classes.other}sm={6} xs={6}>
                    <div >

                    </div>

                </Grid>
                <Grid item sm={6} xs={6}>
                    <div><h2>Enfant</h2></div>
                </Grid>
            </div>
        </Commencer>
</>    
  );
}
